  const context = useContex(RoomContex);
  const {
    handleChange,
    type,
    capacity,
    price,
    minPrice,
    maxPrice,
    minSize,
    maxSize,
    breakfast,
    pets
  } = context;
  return <section className="filter-container">Hello from filter</section>;
}
